import React from 'react';
import "./header.css"

const Header = () => {
    return (
        <div className="header">
            <img className="header-img-right" src="images/Ellipse.png" alt=""/>
            <img className="header-img-left" src="images/Ellipse.png" alt=""/>


        </div>
    );
};

export default Header;
